import InputRadio from "../InputRadio/InputRadio";

function FormTitle(props) {
  return (
    <div className={props.classNameContainer}>
      <InputRadio
        classInput={props.classNameInput}
        classCheck={`${props.classNameExpense} ${props.classNameCheck}`}
        classLabel={style.title}
        label="expense"
        name="title"
        value="expense"
        onChange={categoryChangeHandler}
        checked={formData.category === "expense"}
      />
      <InputRadio
        classInput={style.input}
        classCheck={`${style.income} ${style.check}`}
        classLabel={style.title}
        label="income"
        name="title"
        value="income"
        onChange={categoryChangeHandler}
        checked={formData.category === "income"}
      />
    </div>
  );
}

export default FormTitle;
